import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Banner from './components/Banner.js';
import NavBar from './components/NavBar.js';

function App() {
  return (
    <div className="App">
        <NavBar/>
        <Banner/>
    </div>
  );
}

export default App;
